import React, { Component } from 'react';
import $ from 'jquery';
import './navbar.css';

export class NavBar extends React.Component {
	constructor(props){
		super(props);

	}

	render(){
		return(
			<div class="nav-bar">
				<div class="header"> Estate Locator</div>
				<div class="item"> Sign Up </div>
				<div class="item"> Login </div>
			</div>
		);
	}
}
